import './BowlersBox.css'
import BowlersItem from './BowlersItem';

function BowlersBox(props) {

    return (
        <div className='batsmen_box'>
            {props.batsmen.map((batsman, index) => (
            <BatsmenItem key={index} name={batsman[0]} runs={batsman[1]} balls={batsman[2]} not_out={batsman[3]} team={props.team}/>
            ))}
        </div>
        );

    }

export default BowlersBox;
